import React from 'react';

const RaceCarInfo = () => {
  return (
    <div style={{
      width: '500px',
      padding: '20px',
      backgroundColor: '#008080', // Teal background
      border: '2px solid #808080',
      borderRadius: '5px',
      color: 'white',
    }}>
      {/* Header Section */}
      <div style={{
        display: 'flex',
        alignItems: 'center',
        marginBottom: '10px',
      }}>
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/f/f7/Noun_Project_monopoly_car_icon_45148_cc.svg/800px-Noun_Project_monopoly_car_icon_45148_cc.svg.png" // Replace with the correct URL for the race car image
          alt="Race Car Icon"
          style={{
            width: '30px',
            marginRight: '10px',
            filter: 'invert(1)', // Invert color for better visibility on the background
          }}
        />
        <h2>Race Car</h2>
        <div style={{ marginLeft: 'auto' }}>
          <h2 style={{ color: '#00FF00' }}>$1,220</h2> {/* Green color for money */}
        </div>
      </div>

      {/* Property Slots Section */}
      <div style={{
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'flex-start',
      }}>
        {/* Row 1 */}
        <div style={{ display: 'flex', marginBottom: '5px' }}>
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#CD853F' }}></div> {/* Brown */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#DC143C' }}></div> {/* Red */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: 'white' }}>
            <div style={{ width: '20px', height: '20px', border: '1px solid black', backgroundColor: '#00BFFF' }}></div> {/* Light Blue */}
          </div>
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#FFD700' }}></div> {/* Gold */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: 'white' }}>
             <div style={{ width: '20px', height: '20px', border: '1px solid black', backgroundColor: '#D2691E' }}></div> {/* Chocolate */}
          </div>

        </div>
        {/* Row 2 */}
        <div style={{ display: 'flex', marginBottom: '5px' }}>
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#CD853F' }}></div> {/* Brown */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#DC143C' }}></div> {/* Red */}
           <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#00FF7F' }}></div> {/* Green */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#FFD700' }}></div> {/* Gold */}
           <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#00BFFF' }}></div> {/* Light Blue */}

        </div>
          {/* Row 3 */}
         <div style={{ display: 'flex', marginBottom: '5px' }}>
           <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: 'white' }}></div>
            <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#00FF7F' }}></div> {/* Green */}
          <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: 'white' }}></div>
           <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: '#00BFFF' }}></div> {/* Light Blue */}
           <div style={{ width: '30px', height: '30px', border: '1px solid black', margin: '5px', backgroundColor: 'white' }}></div>
        </div>
      </div>

      {/* House/Hotel Counts Section */}
      <div style={{
        display: 'flex',
        justifyContent: 'flex-start',
        marginTop: '10px',
      }}>
        <div style={{ display: 'flex', alignItems: 'center', marginRight: '20px' }}>
          <svg width="20" height="20" viewBox="0 0 20 20">
            <rect x="2" y="2" width="16" height="10" fill="#32CD32" rx="2" />
            <polygon points="10,12 6,18 14,18" fill="#32CD32" />
          </svg>
          <span style={{ marginLeft: '5px' }}>0</span>
        </div>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <svg width="20" height="20" viewBox="0 0 20 20">
            <rect x="2" y="2" width="16" height="10" fill="#FF0000" rx="2" />
            <polygon points="10,12 6,18 14,18" fill="#FF0000" />
          </svg>
          <span style={{ marginLeft: '5px' }}>0</span>
        </div>
      </div>
    </div>
  );
};

export default RaceCarInfo;
